// SPDX-License-Identifier: MIT
pragma solidity 0.8.6;

import "@chainlink/contracts/src/v0.8/ChainlinkClient.sol";


contract POBArequester is ChainlinkClient {
using Chainlink for Chainlink.Request;

  uint256 public pobaKEY;
  uint256 public index;
  uint256[3] public currentPobaList;
  address public owner;

   //POBA Verifier
  //Oracle - FourSwords.io - POBA api call
  address ORACLE1 = 0x4f843e820abAA164FeDC7E503C510afbe5257F65;
  bytes32 JOBID1 = stringToBytes32("4bbc4a162b79458ab0c246fee7399ef2");
  
  //Oracle - linkmerch - POBA api call
  address ORACLE2 = 0xdEeaA7404D72FB57fB9DA21b4B6e71b5e88f44a2;
  bytes32 JOBID2 = stringToBytes32("cdc382eb18cb47d884f4214f0fda732f");
  
  //Oracle - Divination - POBA api call 
  address ORACLE3 = 0x1F3cf7a276EaAb0b0309b9eae6D48693DcC327f1;
  bytes32 JOBID3 = stringToBytes32("6d87bc4674434a9993575489d7590a24");


  //Oracle payment
  uint256 constant private ORACLE_PAYMENT = 0;

  event RequestPobaKeyFulfilled(
	bytes32 indexed requestId,
	uint256 indexed pobaKey
     );


  constructor() public {
    // polygon erc677
    setChainlinkToken(0xb0897686c545045aFc77CF20eC7A532E3120E0F1); //Polygon Chainlink erc677
    owner = msg.sender;
    currentPobaList[0] = 0;
    currentPobaList[1] = 0;
    currentPobaList[2] = 0;
  }
  

function RequestPOBAkey(address _address, bytes32 _jobID, string memory _licenseKey) public  {
      
        pobaKEY =0;  
        Chainlink.Request memory request = buildChainlinkRequest(_jobID, address(this), this.fulfillpobaKey.selector);
        request.add("endpoint", _licenseKey);
        request.add("aggregationType", "mode");
        request.add("copyPath", "data.licenseKey");
        sendChainlinkRequestTo(_address, request, ORACLE_PAYMENT);
    }



  function fulfillpobaKey(bytes32 _requestId, uint256 _pobaKey)
    public
    recordChainlinkFulfillment(_requestId)
  {
    currentPobaList[index] = _pobaKey; 
    index = (index + 1) % 3;
    	emit RequestPobaKeyFulfilled(_requestId, _pobaKey);

    pobaKEY = _pobaKey;
  }


   function getPobaKEY() public view returns (uint256) {
    return pobaKEY;
  }



   function requestFromAllPOBA(string memory _licenseKey) public{
      RequestPOBAkey(ORACLE1, JOBID1, _licenseKey);
      RequestPOBAkey(ORACLE2, JOBID2, _licenseKey);
      RequestPOBAkey(ORACLE3, JOBID3, _licenseKey);
  }

    
  
  function stringToBytes32(string memory source) public pure returns (bytes32 result) {
    bytes memory tempEmptyStringTest = bytes(source);
    if (tempEmptyStringTest.length == 0) {
      return 0x0;
    }
    assembly { // solhint-disable-line no-inline-assembly
      result := mload(add(source, 32))
    }
  }
   
}

